import "./App.css";

function Unit({ unitCode, title }) {
    unitCode = props.unitCode;
    title = props.title;
    return (
        <p>
            {unitCode}: {title}
        </p>
    );
}

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
        </div>
    );
}

export default App;
